import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import { Nav, Container, Card, Col , Row} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import DropdownButton from 'react-bootstrap/DropdownButton';
import logo from '../assets/logo.png'
import avatar from '../assets/pp.png'

class NavHeader extends React.Component {
	state={
		selectedItem: '',
	}
	render() {
		return (
			<Navbar expand="lg" style={{fontFamily: 'Poppins', fontSize: '14px', color: '#585858'}} className={'row'}>
					<div className={'col-2'}>
						<img width="155px" height="50px" src={logo} alt="" />
					</div>
					<div className={'col-8'}>
						<div className={'row'}>
							<Nav.Link className={ 'col-2'}>
								<span>mainTitle</span>
							</Nav.Link>

							<Nav.Link className={ 'col-2'}>
								<span> schedule</span>
							</Nav.Link>

							<Nav.Link className={ 'col-2'}>
								<span> schedule</span>
							</Nav.Link>
						</div>
						<img width="50px" height="50px" src={avatar} alt="" />

						<Nav.Link
							// as={Link}
							onClick={() =>
								this.setState({ show: true, dropDownFlag: true })
							}
							style={{
								fontFamily: 'Poppins',
								fontSize: '14px',
								color: '#585858',
							}}
						>
							Emily
						</Nav.Link>
					</div>
			</Navbar>
		);
	}
}

export default NavHeader;
